CREATE FUNCTION fcntcycles() RETURNS TABLE(nbcycle bigint, cnt bigint)
    LANGUAGE sql
    AS $$ 
	select a.cxt as nbCycle ,count(*) as cnt from (
		select count(*) as cxt from tmvt group by grp
	) a group by a.cxt order by a.cxt desc $$;


