-- Name: fgetconll(); Type: FUNCTION; Schema: t; Owner: olivier
--

CREATE FUNCTION fgetconll() RETURNS bigint[]
    LANGUAGE plpgsql
    AS $$
DECLARE
	_res int[];
	_iter record;
	_cnt int :=0;
BEGIN
	RAISE INFO 'intersection all cycles (int8->int!!)';
	FOR _iter IN SELECT pat FROM fgetconnected() a(pat) LOOP
		_cnt := _cnt + 1;
		if(_cnt = 1) THEN 
			_res := _iter.pat::int[];
		ELSE
			_res := _res & _iter.pat::int[];
		END IF; 
	END LOOP;
	RETURN _res;
	-- RETURN QUERY SELECT o.id FROM torder o,fgetconnected() c(pat) WHERE o.id=ANY(c.pat) GROUP BY o.id; 
END;
$$;


